import styled from 'styled-components';


const PhotoTextStyle = styled.div`
    .cicle{
        display: flex;
        justify-content: center;
        align-items: center;
        width: 40px;
        height: 40px;
        -moz-border-radius: 50%;
        -webkit-border-radius: 50%;
        border-radius: 50%;
        background: #0F1C51;
    }
    h2{
        font-size:100px;
    }



    @media only screen and (min-width:769px) {
        h2{
        size:100px;
    }
    }

`;

export { PhotoTextStyle };
